import React, { Component } from 'react'
import axios from 'axios';
export default class Rate extends Component {
    constructor() {
        super();
        this.state = {
            weather: "Not yet gotten"
        };
    }
    componentDidMount = () => {
        axios.get("/nrating").then(response => {
            this.setState({
                weather: response.data
            });
        });
    };
    render() {
        return (
            <div>
                <button>Just Click Me</button>
                <h1>
                    I will Show You {this.state.weather}
                </h1>
            </div>
        );
    }
}
